Hi, I want to understand how the interface kernel system works, as I have custom normal flux conditions as well as tangential flux conditions to implement.
UNDERSTANDING InterfaceKernels System using SideSetHeatTransferKernel as an example:
For an interface as described in the documentation (https://mooseframework.inl.gov/source/interfacekernels/SideSetHeatTransferKernel.html), the heat flux on either side of the interface should be equivalent. Considering only conduction for now, we have:

I looked through the file to see how it was implemented and I was wondering some things:
1.  How is q defined? the relationship q = -k∇T is strongly imposed in both heat conduction kernels. That is, this expression is directly substituted in the ADHeatConduction kernel, basically eliminating q from the Heat Equation (writing it all in terms of T). So, how does MOOSE know that q refers to the gradient of temperature multiplied by the thermal conductivity? Even in the BC system, if we prescribe q for a Neumann BC, how does it know that the value defined needs to be scaled by the thermal conductivity at that point to relate it to our temperature variable? Because as far as MOOSE is concerned, q itself doesn't really exist, the both variables and Heat Equation are written entirely in terms of Temperature.
Asking because in the custom formulation I want to implement, q is not strongly connected to Temperature by a simple gradient, it is weakly enforced through kernels that include both q and T (i.e the "Heat Equation" contains both q and T terms i.e q is its own variable), unlike here where q was completely eliminated by a direct substitution.
2. Where is q in the interface condition implementation? Given the definition of the condition (conduction alone), we should have that q_var + C*(T_var - T_neighbor) = 0; and q_neighbor + C*(T_var - T_neighbor) = 0. Looking through the SideSetHeatTransferKernel Source file:
  if (_cond[_qp] != 0.0) // Conduction
  {
    Real jump = _u[_qp] - _neighbor_value[_qp];
    switch (type)
    {
      case Moose::Element:
        r += _cond[_qp] * jump * _test[_i][_qp];
        break;

      case Moose::Neighbor:
        r -= _cond[_qp] * jump * _test_neighbor[_i][_qp];
        break;
    }
  }

In the above, jump =_u[_qp] - _neighbor_value[_qp] is equivalent to (T_var - T_neighbor). I also see that the FE discretization was done twice, for the two cases (i.e _test and _test_neighbor being the test functions multiplied for each case). The only thing that seems to be "missing" is q for each case. Is it automatically assumed that q is added to this for InterfaceKernels? And if so, that brings me back to question 1- how is q defined? As far as MOOSE is concerned, q does not exist, as all the kernels are written COMPLETELY in terms of temperature.
3. What component of q is this being implemented for? In the BC system, it is the normal component of the flux. I looked through the NeumannBC source file and found:
{
  return -_test[_i][_qp] * _value;
}

So my guess is that with [_i] its somehow applying it to the normal component. I couldn't find elsewhere in the file where _i was defined, though.
I ask because I want to implement different interface conditions for the NORMAL component and TANGENTIAL component. So, in my interface condition file, I need to be able to specify that it applies only to the specific components of q I need. Basically, how can I define unit tangent and normal vectors at a boundary so I can multiply my q vector by them?

Just to be sure I understand how it works correctly, writing the weak form of the heat equation (ignoring velocity effects and assuming no volumetric heat source):

Looking through the source files, the time dependent term is implemented with:
ADReal
ADHeatConductionTimeDerivative::precomputeQpResidual()
{
  return _specific_heat[_qp] * _density[_qp] * ADTimeDerivative::precomputeQpResidual();
}

The Kernel part is implemented as:
ADRealVectorValue
ADHeatConduction::precomputeQpResidual()
{
  return _thermal_conductivity[_qp] * ADDiffusion::precomputeQpResidual();
}

Where ADDiffusion, which it inherits from is
ADRealVectorValue
ADDiffusion::precomputeQpResidual()
{
  return _grad_u[_qp];
}

And the use of precomputeQpResidual() ensures that each one is multiplied by the test function/gradient of test function, depending on which is appropriate.
The BC term is not implemented in any of these. What I meant by "finding out" is, is MOOSE able to automatically know what the BC term looks like based on the kernel term, since they both come from a term that was integrated by parts? That is, does MOOSE work backwards based on what you provide as the kernel to get what the BC term should be like? In the case where nothing was integrated by parts (and hence, no grad_test kernel term), how does MOOSE know what the Neumann condition should be like? Will it just be a derivative of the u term?

As for the implementation of the custom interface condition, if I use a kernel with a penalty, since it involves two variables that are defined only on separate blocks, will MOOSE only try to implement it at the interface where both variables are defined? I don't want it to try to force that condition within the bulk of the two blocks, only at the interface. But I've seen that most Kernels do not have the "boundary" option, only the "block" option. My interface condition is of the form:
q.n = f(T, Tn, q)
I was also thinking about strongly enforcing the condition by creating a material file where I use coupleable to couple the needed variables, do the calculations, and then output a material that I can apply as a dirichlet condition for each q variable on either side of the boundary. The things I was wondering are:
-This is an implicit expression for q, will it be able to handle that? i.e a BC that basically depends on the variable itself? Getting it explicitly as a function of q would be hard, but easier to do explicitly as a function of each of the T's.
-I saw in the documentation that I can define "boundary" for material files. Will that ensure that the custom values (that become the dirichlet condition) are only calculated on that boundary?
-Since the condition only applies to the normal component of my q variables, I will need to define an aux variable which is the projection of q on the unit normal to do that. I was thinking of outputting the unit normal at each qp as a material, and then doing the dot product calculation in the "expression" field for the AuxKernel. Can BCs be defined for Aux Variables?
-Alternatively, if I define it explicitly as a function of T then I guess I can do the unit normal dot product within the material file.
-For any of this to work, can I define boundary conditions that depend on a variable? That is, the variables coupled within my material file used to calculate the BC.

So I write a custom bc like this,
#include "ADCustomHeatFluxBC.h"

registerMooseObject("WorkerApp", ADCustomHeatFluxBC);

InputParameters
ADCustomHeatFluxBC::validParams()
{
  InputParameters params = ADIntegratedBC::validParams();
  params.addClassDescription(
      "Custom heat transfer boundary condition with temperature and heat "
      "transfer coefficent given by material properties.");
  params.addRequiredParam<MaterialPropertyName>("T_sat",
                                                "Material property for saturation temperature");
  params.addRequiredParam<MaterialPropertyName>("heat_transfer_coefficient",
                                                "Material property for heat transfer coefficient");
  return params;
}

ADCustomHeatFluxBC::ADCustomHeatFluxBC(const InputParameters & parameters)
  : ADIntegratedBC(parameters),
    _T_sat(getADMaterialProperty<Real>("T_sat")),
    _htc(getADMaterialProperty<Real>("heat_transfer_coefficient"))
{
}

ADReal
ADCustomHeatFluxBC::computeQpResidual()
{
  return -_test[_i][_qp] * _htc[_qp] * std::pow((_T_sat[_qp] - _u[_qp]), 4.);
}

I inherite from ADIntegratedBC, coefficient and T_sat is given by material property. However, the calculated results are different from the analytical solutions in BC, so I wonder if I inherite the wrong BC class for this expression?
